ISLAMABAD, Jul 17 (APP):Khurram Shahzad Virk, a candidate of PTI clinched Punjab Assembly’s PP-140, Sheikhupura by securing 50,166 votes.
According to the results, Mian Khalid Mehmood of PML-N got 32,150 votes.Javed Iqbal of TLP secured only 14,032 votes.The turn out remained 40.65 percent.
